import React from 'react';

export default function Hero(){
    return(
        <div className = "photo-container">
            <img className = "photo-container-image-1" alt = "Gathering"></img>
            <img className = "photo-container-image-2" alt = "Cooking"></img>
            <img className = "photo-container-image-3" alt = "Violin and Guitar"></img>
            <img className = "photo-container-image-4" alt = "Piano"></img>
            <img className = "photo-container-image-5" alt = "Swimming"></img>
            <img className = "photo-container-image-6" alt = "Meditation"></img>
            <img className = "photo-container-image-7"></img>
        </div>
    )
}
